import React from 'react'
import './TimetableComponent.scss'

import timetableData from '../../assets/data/timetableData'

class TimetableComponent extends React.Component{
    constructor(){
        super()

        this.state = {
            timetable_data: timetableData
        }
    }

    render(){
        const {timetable_data} = this.state;
        return(
            <div className='table-element'>
                {
                    timetable_data.map(({id,...otherTimetableProps})=>(
                        <TimetableItemComponent key={id} {...otherTimetableProps}/>
                    ))
                }
            </div>
        )
    }
}
